import { Input, InputLabel } from '@mui/material';
import { Button } from "@mui/material";
import { Box, Container, maxWidth} from '@mui/system';
import { Fragment, useState } from 'react';

const Login = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        const credentials = {
            user_email : email,
            user_password : password
        }
        console.log(credentials);
        setEmail('');
        setPassword('');
    }

    return (
        <Fragment>
            <Container component="main">
                <h2>Login</h2>
                <form onSubmit={handleSubmit}>
                    <Box sx={{maxWidth:300, margin:"auto"}}>
                        <InputLabel sx={{textAlign: "left"}}>Email Address</InputLabel>
                        <Input type='text' sx={{width: 300}} value={email} onChange={e => setEmail(e.target.value)}></Input>
                    </Box>
                    <br></br>
                    <Box sx={{maxWidth:300, margin:"auto"}}>
                        <InputLabel sx={{textAlign: "left"}}>Password</InputLabel>
                        <Input type='password' sx={{width: 300}}value={password} onChange={e => setPassword(e.target.value)}></Input>
                    </Box>
                    <br></br>
                    <Button type='submit' variant='contained' sx={{marginTop: 2}}>Log in</Button>
                </form>
            </Container>
        </Fragment>
    );
}

export default Login;
